import React from 'react';
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Link, Redirect } from 'react-router-dom';

import RegisterForm from './components/RegisterForm';
import BloodRequestForm from './components/BloodRequestForm';

import { createStore, applyMiddleware } from 'redux';
import { Provider } from 'react-redux';
import rootReducer from './reducers';
import thunk from 'redux-thunk';
import '../src/css/style.css';
import Logo from '../src/images/main-logo.png';

class App extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            isLogin : false,
            user : {},
            users : [],
            donationRequest : [],
        }
    }

    render() {
        return (
            <Router>
                <div className="App">
                    <div className="header">
                        <div class="logo">
                            <Link to="/"><img src={Logo} /></Link>
                        </div>
                        <div class="menu-item">
                            <Link path="/login" className="menu">
                                Login
                            </Link>

                            <Link path="/login" className="menu">
                                Sign Up
                            </Link>

                        </div>

                    </div>

                    <div className="nav">
                    <Link to="/request_list">Request List</Link>  <Link to="/donate">Donate</Link> <Link to="/blood/request">Request</Link>                          
                    </div>

                    <div>
                    {/* <Link to="/">Home</Link>  */}

                        <Route path="/donate" render={ props => (<RegisterForm {...props} />)} />
                        <Route path="/blood/request" render={ props => (<BloodRequestForm {...props} />)} />
                    </div>

                </div>
            </Router>
        )
    }
}

const rootElement = document.getElementById("root");
const store = createStore(rootReducer,applyMiddleware(thunk))  ;
ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  rootElement
);
